import React, {Fragment, useState} from 'react';
import {Route, Routes} from "react-router-dom";
import ProjectsPage from "./ProjectsPage";
import TasksPage from "./TasksPage";
import UsersPage from "./UsersPage";
import LogoutPage from "./LogoutPage";
import LoginPage from "./LoginPage";

const LoggedRouter = () => {

    const accessToken = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJzdWIiOiI2NDg4NjA5MDViZjM5ODM0Yzg2NzM0NDQiLCJpYXQiOjE2ODY2NTkyNDR9.ZB2BwanzdEPwfPPDbdVDJRiHc5jb2XzoMxiLT7xbkoo";

  return (
    <Routes>
        <Route exact path="/" element={<ProjectsPage accessToken={accessToken}/>} />
        <Route path="/projects" element={<ProjectsPage accessToken={accessToken}/>} />
        <Route path="/tasks" element={<TasksPage/>} />
        <Route path="/users" element={<UsersPage/>} />
        <Route path="/logout" element={<LogoutPage/>} />
        <Route path="/login" element={<LoginPage/>} />
    </Routes>
  );
};

export default LoggedRouter;
